class REPORT
   REM +--------------------------------------------------------------------------------+;
   REM | 打印样式信息                                                                   |;
   REM +--------------------------------------------------------------------------------+;
   method AddXlsHeader(&file As File);

   REM +--------------------------------------------------------------------------------+;
   REM | 打印标题信息                                                                   |;
   REM +--------------------------------------------------------------------------------+;
   method WriteColName(&file As File, &ary As array of any);

   REM +--------------------------------------------------------------------------------+;
   REM | 打印标题信息 (根据参数可以合并列，行) 子数组：[1]：列名称；[2]：列数；[3]：行数|;
   REM +--------------------------------------------------------------------------------+;
   method WriteColNameNSpan(&file As File, &arr As array of array of any);

   REM +--------------------------------------------------------------------------------+;
   REM | 打印标题信息 (根据参数可以合并列，行) 子数组：[1]：列名称；[2]：列数；[3]：行数|;
   REM +--------------------------------------------------------------------------------+;
   method WriteColNameNSpanStyle(&file As File, &arr As array of array of any);

   REM +--------------------------------------------------------------------------------+;
   REM | 打印数据信息                                                                   |;
   REM +--------------------------------------------------------------------------------+;
   method WriteData(&file As File, &arry As array of array of any);

   REM +--------------------------------------------------------------------------------+;
   REM | 打印结尾信息                                                                   |;
   REM +--------------------------------------------------------------------------------+;
   method WriteEnding(&file As File);

   REM +--------------------------------------------------------------------------------+;
   REM | 打印单元格信息                                                                   |;
   REM +--------------------------------------------------------------------------------+;
   method WriteCellData(&file As File, &value As any, &type As string);

   REM +--------------------------------------------------------------------------------+;
   REM | 打印单元格信息 (可以合并行、合并列，其值必须大于0)                             |;
   REM +--------------------------------------------------------------------------------+;
   method WriteCellDataNSpan(&file As File, &colspan As integer, &rowspan As integer, &value As string, &type As string);

   REM +--------------------------------------------------------------------------------+;
   REM | 打印单元格信息(背景为黄色)                                                     |;
   REM +--------------------------------------------------------------------------------+;
   method WriteCellData_yellow(&file As File, &value As string, &type As string);

   REM +--------------------------------------------------------------------------------+;
   REM | 打印单元格信息(背景为红色)                                                     |;
   REM +--------------------------------------------------------------------------------+;
   method WriteCellData_red(&file As File, &value As string, &type As string);

   REM +--------------------------------------------------------------------------------+;
   REM | 打印单元格信息(背景为蓝色)                                                     |;
   REM +--------------------------------------------------------------------------------+;
   method WriteCellData_blud(&file As File, &value As string, &type As string);

   REM +--------------------------------------------------------------------------------+;
   REM | 打印报表头信息                                                                 |;
   REM +--------------------------------------------------------------------------------+;
   method WritePara(&file As File, &arr As array of array of any);

   REM +--------------------------------------------------------------------------------+;
   REM | 打印报表头信息（包含数字）                                                     |;
   REM +--------------------------------------------------------------------------------+;
   method WriteParaType(&file As File, &arr As array of array of any);

   property File filename;
private
   instance File &f;

end-class;


