REM +--------------------------------------------------------------------------------+;
method WriteColName
   /+ &file as File, +/
   /+ &ary as Array of Any +/
   Local number &i;
   Local string &class;
   &file.WriteLine("<tr>");

   For &i = 1 To &ary.Len
      &class = "<td class=xl28 />";
      &file.WriteLine(&class | &ary [&i]);

   End-For;

   &file.WriteLine("</tr>");
end-method;


REM +--------------------------------------------------------------------------------+;
REM | 打印标题信息 （可以根据参数合并列、行）     
REM +--------------------------------------------------------------------------------+;
method WriteColNameNSpan
   /+ &file as File, +/
   /+ &arr as Array2 of Any +/

   Local number &i;
   &file.WriteLine("<tr>");
   For &i = 1 To &arr.Len
      &file.WriteLine("<td  class=xl28 colspan=" | &arr [&i][2] | " rowspan=" | &arr [&i][3] | "/>" | &arr [&i][1]);
   End-For;
   &file.WriteLine("</tr>");
end-method;


REM +--------------------------------------------------------------------------------+;
REM | 增加样式打印标题信息 （可以根据参数合并列、行）                                                                  |;
REM +--------------------------------------------------------------------------------+;
method WriteColNameNSpanStyle
   /+ &file as File, +/
   /+ &arr as Array2 of Any +/
   Local number &i;
   &file.WriteLine("<tr>");
   For &i = 1 To &arr.Len
      &file.WriteLine("<td colspan=" | &arr [&i][2] | " rowspan=" | &arr [&i][3] | " class='xl28'/>" | &arr [&i][1]);
   End-For;
   &file.WriteLine("</tr>");
end-method;

REM +--------------------------------------------------------------------------------+;
REM | 打印数据信息                                                                   |;
REM +--------------------------------------------------------------------------------+;
method WriteData
   /+ &file as File, +/
   /+ &arry as Array2 of Any +/
   Local number &i, &j;
   For &i = 1 To &arry.Len
      &file.WriteLine("<tr>");
      For &j = 1 To &arry [&i].Len
         &file.WriteLine("<td class=s />" | &arry [&i][&j]);
      End-For;
      &file.WriteLine("</tr>");
   End-For;
end-method;


REM +--------------------------------------------------------------------------------+;
REM | 打印数据信息                                                                   |;
REM +--------------------------------------------------------------------------------+;
method WriteCellData
   /+ &file as File, +/
   /+ &value as Any, +/
   /+ &type as String +/
   Local number &i, &j;

   If &type = "30" Then
      &file.WriteLine("<td class=s />" | String(&value));
   Else
      If &type = "55" Then
         &file.WriteLine("<td class=pers x:num />" | Value(&value));
      Else
         &file.WriteLine("<td class=n x:num />" | Value(&value));
      End-If;
   End-If;

end-method;

REM +--------------------------------------------------------------------------------+;
REM | 打印数据信息   colspan 合并列数；rowspan 合并行数                              |;
REM +--------------------------------------------------------------------------------+;
method WriteCellDataNSpan
   /+ &file as File, +/
   /+ &colspan as Integer, +/
   /+ &rowspan as Integer, +/
   /+ &value as String, +/
   /+ &type as String +/
   If None(&colspan) Or
         &colspan < 1 Then
      &colspan = 1;
   End-If;
   If None(&rowspan) Or
         &rowspan < 1 Then
      &rowspan = 1;
   End-If;
   If &type = "30" Then
      &file.WriteLine("<td class=s colspan=" | &colspan | " rowspan = " | &rowspan | "/>" | String(&value));
   Else
      &file.WriteLine("<td class=n x:num   colspan=" | &colspan | " rowspan = " | &rowspan | " />" | Value(&value));
   End-If;

end-method;


REM +--------------------------------------------------------------------------------+;
REM | 打印数据信息(背景为黄色)                                                                   |;
REM +--------------------------------------------------------------------------------+;
method WriteCellData_yellow
   /+ &file as File, +/
   /+ &value as String, +/
   /+ &type as String +/
   Local number &i, &j;

   &file.WriteLine("<td class=s_yellow />" | String(&value));

end-method;

