REM +--------------------------------------------------------------------------------+;
REM | 打印报表结尾信息                                                                   |;
REM +--------------------------------------------------------------------------------+;
method WriteEnding
   /+ &file as File +/

   &file.WriteLine("</body>                                                              ");
   &file.WriteLine("</table>                                                              ");
   &file.WriteLine("</html>");
end-method;

REM +--------------------------------------------------------------------------------+;
REM | 打印报表头信息                                                                   |;
REM +--------------------------------------------------------------------------------+;
method WritePara
   /+ &file as File, +/
   /+ &arr as Array2 of Any +/
   Local number &i;
   For &i = 1 To &arr.Len
      If All(&arr [&i][2]) Then
         &file.WriteLine("<tr>");
         &file.WriteLine("<td class=s colspan=2 />" | &arr [&i][1] | ":");
         &file.WriteLine("<td class=s colspan=2 />" | &arr [&i][2]);
         &file.WriteLine("</tr>");
      End-If;
   End-For;

   &file.WriteLine("<tr/>");

end-method;


REM +--------------------------------------------------------------------------------+;
REM | 打印报表头信息(包含数字)                                                                   |;
REM +--------------------------------------------------------------------------------+;
method WriteParaType
   /+ &file as File, +/
   /+ &arr as Array2 of Any +/

   Local number &i;
   For &i = 1 To &arr.Len

      &file.WriteLine("<tr>");
      &file.WriteLine("<td/>" | &arr [&i][1] | ":");
      If &arr [&i][3] = "30" Then
         &file.WriteLine("<td class=s />" | String(&arr [&i][2]));
      Else
         &file.WriteLine("<td class=n x:num />" | Value(&arr [&i][2]));
      End-If;
      &file.WriteLine("</tr>");
   End-For;

   &file.WriteLine("<tr/>");

end-method;
